import React from "react";
import { View, Text, StyleSheet } from "react-native";
const App = () => (
  <View style={Styles.container}>
    <Text> Redux Hooks Demo App </Text>
  </View>
);
export default App;
const Styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});
